let handleGetAllRestaurants = async (req, res) => {
  try {
    let data = await restaurantService.getAllRestaurants();
    return res.json({
      status: 200,
      message: "OK",
      data: data.data,
    });
  } catch (e) {
    console.log(e);
    return res.status(500).json({
      status: 500,
      message: "Error from server...",
      data: "",
    });
  }
};

// let handleGetAllTypeNames = async (req, res) => {
