let getAllRestaurants = () => {
  return new Promise(async (resolve, reject) => {
    try {
      let restaurants = await db.Restaurant.findAll({
        where: { isDelete: "0" },
        attributes: [
          "id",
          "name",
          "address",
          "provinceId",
          "image",
          "latitude",
          "longitude",
          "isOpen",
        ],
      });
      resolve({
        status: 200,
        message: "OK",
        data: restaurants,
      });
    } catch (e) {
      reject(e);
    }
  });
};

let getAllTypeNames = () => {
  return new Promise(async (resolve, reject) => {
    try {
      let typeNames = await db.Type.findAll({
        attributes: {
          exclude: ["image"],
        },
      });

      resolve({
        errCode: 0,
        data: typeNames,
      });
    } catch (e) {
      reject(e);
    }
  });
};

let checkExistRestaurant = (address) => {
  return new Promise(async (resolve, reject) => {
    try {
      let res = await db.Restaurant.findOne({
        where: { address: address },
      });
      if (res) {
        resolve(true);
      } else {
        resolve(false);
      }
    } catch (e) {
      reject(e);
    }
  });
};

let createNewRestaurant = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      let isExistRestaurant = await checkExistRestaurant(data.address);
      if (isExistRestaurant) {
        return resolve({
          status: 400,
          message: "Restaurant is exist, please enter other restaurant",
          data: "",
        });
      }
      let restaurant = await db.Restaurant.create({
        name: data.name,
        provinceId: data.provinceId,
        image: data.image,
        address: data.address,
        longitude: data.longitude,
        latitude: data.latitude,
        isOpen: 0,
        isDelete: "0",
      });
      resolve({
        status: 200,
        message: "OK",
        data: restaurant,
      });
    } catch (e) {
      reject(e);
    }
  });
};

let deleteRestaurant = (restaurantId) => {
  return new Promise(async (resolve, reject) => {
    try {
      const restaurant = await db.Restaurant.findOne({
        where: { id: restaurantId },
        raw: false,
      });
      if (!restaurant) {
        return resolve({
          status: 404,
          message: "restaurant is not exist!",
          data: "",
        });
      } else {
        restaurant.isDelete = "1";
        restaurant.isOpen = "0";
        await restaurant.save();
        return resolve({
          status: 200,
          message: "Delete the table succeeds! (Restaurant still exists in db)",
          data: restaurant,
        });
      }
    } catch (error) {
      reject(error);
    }
  });
};

let updateRestaurantData = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        return resolve({
          status: 400,
          message: "Missing required parameter",
          data: "",
        });
      }
      let restaurant = await db.Restaurant.findOne({
        where: { id: data.id },
        raw: false,
      });
      if (restaurant) {
        for (let key in data) {
          if (key !== "id" && data[key] !== null) {
            restaurant[key] = data[key];
          }
        }
        await restaurant.save();
        return resolve({
          status: 200,
          message: "Update the restaurant succeeds!",
          data: restaurant,
        });
      } else {
        return resolve({
          status: 404,
          message: "Restaurant is not exist",
          data: "",
        });
      }
    } catch (e) {
      reject(e);
    }
  });
};

