          status: 400,
          message: "Missing required parameter!",
          data: "",
        });
      } else {
        let data = await db.Restaurant.findOne({
          where: { id: inputId },
        });
        if (data) {
          return resolve({
            status: 200,
            message: "OK",
            data: data,
          });
        } else {
          return resolve({
            status: 404,
            message: "Restaurant is not exist",
