import db from "../models/index";
let bookTable = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (
        !data.resTime ||
        !data.resDate ||
        !data.people ||
        !data.restaurantId ||
        !data.fullName ||
        !data.phoneNumber ||
        !data.email ||
        data.resTime === "" ||
        data.resDate === "" ||
        data.people === "" ||
        data.restaurantId === "" ||
        data.fullName === "" ||
        data.phoneNumber === "" ||
        data.email === ""
      ) {
        resolve({
          status: 400,
          message: "Missing required parameter!",
          data: "",
        });
      }
      let order;
      order = await db.Order.create({
        resStatus: "pending",
        fullName: data.fullName,
        phoneNumber: data.phoneNumber,
        resDate: data.resDate,
        resTime: data.resTime,
        people: data.people,
        depositAmount: 0,
        restaurantId: data.restaurantId,
        email: data.email,
        cusId: data.id ?? null,
      });

      let totalDepositAmount = 0;
      for (let item of data.orderItemArray) {
        let dish = await db.Dish.findOne({
          where: { id: item.dishId },
          raw: false,
        });
        let price = dish.price * item.quantity;
        let depositAmount = price * 0.3;
        totalDepositAmount += depositAmount;
        await db.OrderItem.create({
          orderId: order.id,
          dishId: item.dishId,
          quantity: item.quantity,
          price: price,
          status: "waiting",
          note: item.note,
        });
      }
      order.depositAmount = totalDepositAmount;
      order.totalAmount = totalDepositAmount/0.3;
      await order.save();
      resolve({
        status: 201,
        message: "Book table successfully!",
        data: order,
      });
    } catch (e) {
      reject(e);
    }
  });
};

