const updateOrderItem = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.items || !data.orderId) {
        resolve({
          status: 400,
          message: "Missing required parameter",
          data: "",
        });
      }
      let order = await db.Order.findOne({
        where: { id: data.orderId },
      });

      if (!order) {
        resolve({
          status: 404,
          message: "Order is not exist",
          data: "",
        });
      }
      for (let item of data.items) {
        if (item.action === "add") {
          await db.OrderItem.create({
            orderId: data.orderId,
            dishId: item.dishId,
            quantity: item.quantity,
            price: item.price,
          });
          continue;
        }
        if (item.action === "delete") {
          await db.OrderItem.destroy({
            where: {
              id: item.id,
            },
          });
          continue;
        }
        let orderItem = await db.OrderItem.findOne({
          where: {
            id: item.id,
          },
          raw: false,
        });
        if (!orderItem) {
          resolve({
            status: 404,
            message: "Order item is not exist",
            data: "",
          });
          return;
        }
        for (let key in item) {
          if (key !== "id") orderItem[key] = item[key];
        }
        await orderItem.save();
      }
      let dishes = [];

      let orderItems = await db.OrderItem.findAll({
        where: { orderId: data.orderId },
      });
      if (orderItems.length > 0) {
        for (let i = 0; i < orderItems.length; i++) {
          let dish = await db.Dish.findOne({
            where: { id: orderItems[i].dishId },
          });
          dishes.push({
            id: orderItems[i].id,
            dishId: dish.id,
            dishName: dish.name,
            price: orderItems[i].price,
            quantity: orderItems[i].quantity,
          });
        }
      }
      resolve({
        status: 200,
        message: "Update order item successfully",
        data: dishes,
      });
    } catch (e) {
      reject(e);
    }
  });
};

const newUpdateOrder = (data) => {
  return new Promise(async (resolve, reject) => {
    console.log("🚀 ~ newUpdateOrder ~ data:", data);
    try {
      if (!data.orderId) {
        resolve({
          status: 400,
          message: "Missing required parameter",
          data: "",
        });
        return;
      }
      let order = await db.Order.findOne({
        where: { id: data.orderId },
        raw: false,
      });

      if (!order) {
        resolve({
          status: 404,
          message: "Order is not exist",
          data: "",
        });
        return;
      }
      if (data.orderStatus) {
        let preStatus = order.resStatus;
        order.resStatus = data.orderStatus;
        await order.save();
        if (preStatus === "pending" && data.orderStatus === "confirmed") {
          await mailer.notifyOrderPlaceSuccess(order);
        }
        if (data.orderStatus === "canceled") {
          await mailer.notifyOrderCanceled(order);
        }
      }
      if (data.newOrderItems) {
        let totalAmount = 0;
        await db.OrderItem.destroy({
          where: {
            orderId: data.orderId,
          },
        });
        for (let item of data.newOrderItems) {
          totalAmount += item.total;
          await db.OrderItem.create({
            orderId: data.orderId,
            dishId: item.dishId,
            quantity: item.quantity,
            price: item.total,
          });
        }
        order.totalAmount = totalAmount;
        await order.save();
      }
      if (data.newTables) {
        await db.Table.update(
          { orderId: 0 },
          {
            where: {
              orderId: order.id,
            },
          }
        );
        for (let table of data.newTables) {
          await db.Table.update(
            { orderId: order.id },
            {
              where: {
                id: table.id,
              },
            }
          );
        }
      }
      resolve({
        status: 200,
        message: "Update order status success!",
        data: order,
      });
    } catch (e) {
      reject(e);
    }
  });
};

const checkoutOrder = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (
        !data.orderId ||
        !data.receivedMoney ||
        data.orderId === "" ||
        data.receivedMoney === ""
      )
        resolve({
          status: 400,
          message: "Missing required parameter",
        });
      let order = await db.Order.findOne({
        where: { id: data.orderId },
        raw: false,
      });
      if (!order) {
        resolve({
          status: 404,
          message: "Order is not exist",
          data: "",
        });
        return;
      }
      let subAmount = order.totalAmount - order.depositAmount;
      let change = data.receivedMoney - subAmount;
      return resolve({
        status: 200,
        message: "Checkout successful",
        data: {
          subAmount,
          change,
        },
      });
    } catch (e) {
      reject(e);
    }
  });
};

