  getAllOrdersByRestaurantId,
  updateStatusOrder,
  getAllOrdersByCustomerPhoneNumber,
  getDetailOrderByOrderId,
  updateOrder,
  updateOrderItem,
  newUpdateOrder,
  createOrderByStaff,
  getAllOrdersByCustomerId,
  checkoutOrder,
};

